import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFaceKiss } from '@fortawesome/free-solid-svg-icons';
import { Card, Modal } from 'antd';
import { useState } from 'react';
import { useSelector } from 'react-redux';

const Followers = () => {

  const {me} = useSelector((state) => state.user);

  const [isModalOpen, setIsModalOpen] = useState(false);

  console.log("팔로워리스트", me);

  const referModal = () => {
    setIsModalOpen(true);
  };

  const handleCancel = () => {
    setIsModalOpen(false);
  };

  const IfLike = () => {

      if(me.Liked[0] !== undefined){
        return <li><FontAwesomeIcon icon={faFaceKiss} style={{fontSize:15, color: 'pink'}} /> {me.Liked[0].lookName}</li>;
      }
      if(me.Liked[1] !== undefined){
        return <li><FontAwesomeIcon icon={faFaceKiss} style={{fontSize:15, color: 'pink'}} />{me.Liked[1].lookName}</li>;
      }
      if(me.Liked[2] !== undefined){
        return <li><FontAwesomeIcon icon={faFaceKiss} style={{fontSize:15, color: 'pink'}} />{me.Liked[2].lookName}</li>;
      }
      else{
        return  <div></div>;
      }

  };

    return(
      <div className="site-card-border-less-wrapper">
        <Card
          title="Followers"
          style={{width: 300, marginLeft: 50}}
          
        >
          <p></p>
        
        </Card>
        <Modal title={me.nickname + " 의 팔로워 목록"} footer={null} onCancel={handleCancel} open={isModalOpen}>

        </Modal>
      </div>
    );

};

export default Followers;
